INSERT INTO `products` VALUES (6,'Men\'S Adidas',98,60,'/imgShoes/CI9914.png','4/8/2022 00:00','Men\'s adidas Running Nayo 1.0 shoes',4999,'Singapore','The adidas Nayo 1.0 shoes for men. These lightweight running shoes give all round comfort, cushioning, durability & support in a simplistic design. The mesh upper ensure breathability and durability while the Light strike EVA midsole provides premium cushioning\'s. Full Rubber outsole provides durability.','Men'),(7,'Men\'S Adidas',6,50,'/imgShoes/EE8252.png','5/9/2022 00:00','Men\'s adidas Sports Inspired Lite Racer Shoes',4299,'Singapore','The ultra-lightweight build of these shoes takes a running-inspired style to the streets. The sporty look has a breathable and durable mesh upper with stitched-on 3-Stripes. EVA cushioning provides lightweight comfort for every step.','Men'),(8,'Men\'S Adidas',17,50,'/imgShoes/CK9664.png','8/18/2022 0:00','Men\'s adidas Running Nepton 2.0 Shoes',5999,'Singapore','Sleek design with reflective three stripes makes it a contemporary yet functional shoe. Breathable textile upper for maximum ventilation and a cushioned midsole provides all-day comfort with rubber outsole for best durability in high wear areas.','Men'),(9,'Men\'S Adidas',17,50,'/imgShoes/CL7602.png','3/15/2022 0:00','Men\'s adidas Running Torik Shoes',4799,'Singapore','A well cushioned shoe with a fresher look that will appeal to young runners. Features Mesh upper for maximum ventilation, lightstrike IMEVA midsole with visible adiprene providing protection from harmful impact forces and durable Rubber outsole for long-lasting wear.','Men'),(10,'Men\'S Adidas',28,50,'/imgShoes/CL7494.png','5/15/2022 0:00','Men\'s adidas Sport Inspired Kalus 1.0 Shoes',4599,'Singapore','A well cushioned running-inspired shoes with a fresher look that will appeal to all. Features Mesh upper for maximum ventilation, lightstrike IMEVA midsole with visible adiprene providing protection from harmful impact forces and durable Rubber outsole for long-lasting wear.','Men'),(11,'Men\'S Adidas',88,40,'/imgShoes/EE7923.png','3/9/2022 00:00','Men\'s adidas Running Duramo 9 Shoes',5999,'Singapore','These men\'s running shoes will get you on the road to your goals. A sandwich mesh upper offers lightweight breathability, while a seamless print overlay adds support for a stable stride. The midsole offers pillow-soft Cloudfoam cushioning that eases every stride.','Men'),(12,'Men\'S Adidas',8,50,'/imgShoes/CI1821.png','2/14/2022 0:00','MEN\'S adidas RUNNING YAMO 1.0 SHOES',4799,'Singapore','The adidas Yamo 1.0 shoes for men. These lightweight running shoes have a combination of Synthetic with double layer Mesh ensure breathability and durability while the Lightstrike EVA midsole provides premium cushionings. Full Rubber outsole provides durability.','Men'),(13,'Men\'S Adidas',64,50,'/imgShoes/CJ0082.png','2/7/2022 00:00','men\'s ADIDAS RUNNING NEBULAR 1.0 SHOES',4599,'Singapore','The premium looking adidas Nebular 1.0 Running shoes for men crafted with Mesh overlays which make it lightweight. The breathable sandwich Mesh offer extended ventilation and comfort. Light strike IMEVA midsole with full Rubber outsole provides durability.','Men'),(14,'Men\'S Adidas',52,50,'/imgShoes/CJ8062.png','6/7/2022 00:00','MEN\'S ADIDAS RUNNING LEGUS SHOES',5999,'Singapore','Get maximum support, comfort and a refreshed look with these adidas Legus shoes for men. The textile mesh upper is breathable and has a sock-like fit and the supportive cage in the shoe\'s midfoot provides midfoot lockdown. CLOUDFOAM gives instant step in-comfort, long-lasting responsive cushioning and a super-plush feel and the Rubber outsole gives ultimate durability.','Men'),(15,'Men\'S Adidas',59,40,'/imgShoes/CM0068.png','3/3/2022 00:00','Men\'s adidas Toe Side II Slippers',1299,'Singapore','The adidas casual sandals for men with a striking camouflage design. Features stylish webbing straps, Diecut EVA midsole for stable cushioning and abrasion resistant rubb